import React, { Component } from "react"
import {  Card, CardBody } from "reactstrap"


class Lead extends Component{
    render() {
return (
    <React.Fragment>
            <Card>
                <CardBody>
                <div className="mb-4 h4 card-title">Active Leads</div>
                </CardBody>
            </Card>
    </React.Fragment>
)

        }
}

export default Lead;
